export const removeFromWishlist=async(productId,encodedToken)=>{
    try{
        console.log(productId)
    const response=await fetch(`/api/user/wishlist/${productId}`,
    {  
        method:'DELETE',
        headers:{'authorization':encodedToken},
    }
    );
    const data=await response.json();
    console.log(data);
    }
    catch(e){
        console.log(e)
    }
    }
